INSERT INTO vote (id, voting_id, created_at, created_by, comment, score) VALUES ('1946cc4e-c73e-4b2a-9bc6-e935bf8ee89f', '896412b7-f82e-4a1a-a2e5-87adca66e3f9', now(), 'e5d0d6c1-1691-4a61-9ccd-99f9c35ab8fb', E'Marked - Markdown Parser\n========================\n\n[Marked] lets you convert [Markdown] into HTML.  Markdown is ~~not~~ a _simple text format_ whose goal is to be very easy to read and write, even when not converted to HTML.  This demo page will let you type anything you like and see how it gets converted.  Live.  No more waiting around.\n\nHow To Use The Demo\n-------------------\n\n1. Type in stuff **on the left**.\n2. See the live updates on the right.\n\nThat\'s it.  Pretty simple.  There\'s also a drop-down option in the upper right to switch between various views:\n\n- **Preview:**  A live display of the generated HTML as it would render in a browser.\n- **HTML Source:**  The generated HTML before your browser makes it pretty.\n- **Lexer Data:**  What [marked] uses internally, in case you like gory stuff like this.\n- **Quick Reference:**  A brief run-down of how to format things using markdown.\n\nWhy Markdown?\n-------------\n\nIt\'s easy.  It\'s not overly bloated, unlike HTML.  Also, as the creator of [markdown] says,\n\n> The overriding design goal for Markdown\'s\n> formatting syntax is to make it as readable\n> as possible. The idea is that a\n> Markdown-formatted document should be\n> publishable as-is, as plain text, without\n> looking like it\'s been marked up with tags\n> or formatting instructions.\n\nReady to start writing?  Either start changing stuff on the left or\n[clear everything](/demo/?text=) with a simple click.\n\n[Marked]: https://github.com/markedjs/marked/\n[Markdown]: http://daringfireball.net/projects/markdown/\n\n1.  List item one.\n\n    List item one continued with a second paragraph followed by an\n    Indented block.\n\n        $ ls *.sh\n        $ mv *.sh ~/tmp\n\n    List item continued with a third paragraph.\n\n2.  List item two continued with an open block.\n\n    This paragraph is part of the preceding list item.\n\n    1. This list is nested and does not require explicit item continuation.\n\n       This paragraph is part of the preceding list item.\n\n    2. List item b.\n\n    This paragraph belongs to item two of the outer list.\n\n```ruby\ndef foo(x)\n  return 3\nend\n```\n\n\n| Left-aligned | Center-aligned | Right-aligned |\n| :---         |     :---:      |          ---: |\n| git status   | git status     | git status    |\n| git diff     | git diff       | git diff      |\n\n    \nEnriched Blockquote\n\n> # Foo\n> bar\n> baz\n\n- [x] foo\n  - [ ] bar\n  - [x] baz\n- [ ] bim\n\n![](https://media.giphy.com/media/o9ncKTCVc5FwA/giphy.gif)\n\n![](https://media.giphy.com/media/1xOeYi2hqOs7C1FzuN/giphy.gif)', 2);
